import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the location input by placeholder (alternative selector)
    await page.waitForSelector('input[placeholder="Search destinations"]', { timeout: 5000 });

    // Type a location using placeholder selector
    await page.fill('input[placeholder="Search destinations"]', 'Seoul');
    await page.waitForTimeout(300);

    // Take screenshot after entering location
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_location_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_location_filled.png'));

    // Wait for check-in and check-out date inputs (by type)
    await page.waitForSelector('input[type="date"]', { timeout: 5000 });
    const dateInputs = await page.$$('input[type="date"]');
    // Fill check-in and check-out dates (using index instead of IDs)
    const today = new Date();
    const checkin = today.toISOString().split('T')[0];
    const checkoutDate = new Date(today);
    checkoutDate.setDate(today.getDate() + 3);
    const checkout = checkoutDate.toISOString().split('T')[0];

    await dateInputs[0].fill(checkin);
    await dateInputs[1].fill(checkout);
    await page.waitForTimeout(300);

    // Take screenshot after dates filled
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_dates_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_dates_filled.png'));

    // Click the "Add guests" button by visible text (alternative to class)
    const guestBtn = await page.locator('button', { hasText: 'Add guests' }).first();
    await guestBtn.waitFor({ state: 'visible', timeout: 3000 });
    await guestBtn.click();
    await page.waitForTimeout(300);

    // Find all "+" buttons (use nth occurrence, not class)
    const plusButtons = await page.locator('button', { hasText: '+' }).all();
    // Click the first "+" three times (simulate adding 3 adults)
    for (let i = 0; i < 3; i++) {
      await plusButtons[0].click();
      await page.waitForTimeout(100);
    }

    // Click the second "+" once (simulate adding 1 child)
    if (plusButtons.length > 1) {
      await plusButtons[1].click();
      await page.waitForTimeout(100);
    }

    // Take screenshot after guest selection
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_guests_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_guests_selected.png'));

    // Click the "Stays" tab using XPath (alternative selector)
    const staysTab = await page.locator('//button[contains(@class,"search-tab") and contains(text(),"Stays")]').first();
    await staysTab.click();
    await page.waitForTimeout(200);

    // Click the "Beachfront" filter using text (alternative to data-filter)
    const beachfrontFilter = await page.locator('button.filter-btn', { hasText: 'Beachfront' }).first();
    await beachfrontFilter.click();
    await page.waitForTimeout(300);

    // Take screenshot after filter applied
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_filter_applied.png'));

    // Click the search button by class (no text)
    const searchBtn = await page.locator('button.search-btn').first();
    await searchBtn.click();
    await page.waitForTimeout(1000);

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_search_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_search_clicked.png'));

    // Wait for a listing card to appear (by class, alternative to ID)
    await page.waitForSelector('.listing-card', { timeout: 5000 });

    // Extract the title and price of the first listing card using alternative selectors
    const firstCard = await page.locator('.listing-card').first();
    const title = await firstCard.locator('.listing-location').textContent();
    const price = await firstCard.locator('.listing-price .amount').textContent();

    // Take screenshot of the first listing card
    const cardBox = await firstCard.boundingBox();
    if (cardBox) {
      await page.screenshot({
        path: path.join(screenshotsDir, 'step_7_first_listing.png'),
        clip: cardBox
      });
      screenshots.push(path.join(screenshotsDir, 'step_7_first_listing.png'));
    }

    // Return result
    return {
      success: true,
      action: "Performed search with location, dates, guests, filter, and extracted first listing data",
      extractedData: {
        firstListing: {
          title: title ? title.trim() : null,
          price: price ? price.trim() : null
        }
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
